const debugTouchable = ({ after = false } = {}) => process.env.NODE_ENV === "production" ? {} : {
  selectors: {
    [`[data-braid-debug] &${after ? ":after" : ""}`]: {
      background: "red",
      opacity: 0.2
    }
  }
};
export {
  debugTouchable
};
